import '../Styles/Side-menu.css'
const SideMenu = () => {

  return (
        <div className="menu-box">
            <h3>
                <div><a href="/dashboard">Dashboard</a></div>
                <div><a href="/pulling">View Pulling Configuration</a></div>
                <div><a href="/table">View Table Configuration</a></div>
                <div><a href="/model">View Trained Model</a></div>
                <div><a href="/user-mode">Switch Normal User Mode</a></div>
            </h3>
        </div>
  );
};

export default SideMenu;
